import {Data} from '../helpers/Data';
import { MenuItem } from './MenuItem';

function Menu() {
  return (
    <div className='menu'>
      <h1 className='menuTitle'>Burgerlerimiz</h1>
      <div className='menuList'>
         {Data.map((menuItem,key)=>{
            return(
              <MenuItem 
                 image={menuItem.image}
                 name={menuItem.name}
                 content
              />
            )
         })}
      </div>
    </div>
  )
}

export default Menu;
